class ListItem extends Component {
    constructor() {
        super()
        this.state = {
            user: {
                name: "",
                type: "",
            },
        }
    }

    render() {
        this.state.user = this.props.user

        return (
            <div>
                <button onClick={this.props.onDisplay(this.state.user)}>
                    {this.state.user.name}
                </button>
                <button onClick={this.props.onDelete(this.state.user)}>
                    Djjj
                </button>
            </div>
        )
    }
}

